import React, { useState, useEffect } from 'react';

function ViewRegistration() {
  const [companyDetails, setCompanyDetails] = useState(null);
  const [isSidebarOpen, setIsSidebarOpen] = useState(false);

  useEffect(() => {
    const companyData = JSON.parse(localStorage.getItem('companies')) || [];
    // Assuming companyData is filtered by company name or ID, for demonstration.
    setCompanyDetails(companyData[0]);
  }, []);

  const handleDownloadDocument = () => {
    if (companyDetails?.documentName) {
      const documentUrl = `/path/to/documents/${companyDetails.documentName}`; // Adjust the path as necessary
      const link = document.createElement('a');
      link.href = documentUrl;
      link.download = companyDetails.documentName;
      link.click();
    }
  };

  const handleAccept = () => {
    alert('Company Accepted');
    // Handle company acceptance logic
  };

  const handleReject = () => {
    alert('Company Rejected');
    // Handle company rejection logic
  };

  return (
    <div style={{ display: 'flex' }}>
      <button
        onClick={() => setIsSidebarOpen(!isSidebarOpen)}
        style={{
          padding: '10px',
          backgroundColor: '#007bff',
          color: 'white',
          border: 'none',
          cursor: 'pointer',
        }}
      >
        {isSidebarOpen ? 'Close Sidebar' : 'View Company Details'}
      </button>

      {isSidebarOpen && companyDetails && (
        <div
          style={{
            position: 'fixed',
            top: 0,
            right: 0,
            width: '350px',
            height: '100vh',
            backgroundColor: '#f8f9fa',
            boxShadow: '-2px 0 5px rgba(0,0,0,0.2)',
            padding: '20px',
            zIndex: 1000,
            overflowY: 'auto',
          }}
        >
          <button
            onClick={() => setIsSidebarOpen(false)}
            style={{
              position: 'absolute',
              top: '10px',
              right: '10px',
              padding: '5px 10px',
              backgroundColor: 'grey',
              color: 'white',
              border: 'none',
              cursor: 'pointer',
              borderRadius: '4px',
            }}
          >
            Close
          </button>
          <h2 style={{ textAlign: 'center' }}>Company Details</h2>

          <div style={{ textAlign: 'center', marginBottom: '15px' }}>
            {companyDetails.companyLogo ? (
              <img
                src={companyDetails.companyLogo}
                alt={`${companyDetails.companyName} logo`}
                style={{
                  width: '150px',
                  height: '150px',
                  marginBottom: '10px',
                  borderRadius: '50%',
                }}
              />
            ) : (
              <p>No logo uploaded</p>
            )}
            <h3>{companyDetails.companyName}</h3>
          </div>

          <p><strong>Industry:</strong> {companyDetails.industry}</p>
          <p><strong>Company Size:</strong> {companyDetails.companySize}</p>
          <p><strong>Email:</strong> {companyDetails.companyEmail}</p>

          {/* Download Button for Legal Document */}
          {companyDetails.documentName && (
            <div style={{ textAlign: 'center', marginTop: '20px' }}>
              <button
                onClick={handleDownloadDocument}
                style={{
                  padding: '10px 20px',
                  backgroundColor: '#007bff',
                  color: 'white',
                  textDecoration: 'none',
                  borderRadius: '5px',
                  cursor: 'pointer',
                }}
              >
                Download Legal Document
              </button>
            </div>
          )}

          <div style={{ display: 'flex', justifyContent: 'space-around', marginTop: '20px' }}>
            <button
              onClick={handleAccept}
              style={{
                padding: '10px 20px',
                backgroundColor: '#4CAF50',
                color: 'white',
                border: 'none',
                borderRadius: '5px',
                cursor: 'pointer',
                flex: 1,
                marginRight: '5px',
              }}
            >
              Accept
            </button>
            <button
              onClick={handleReject}
              style={{
                padding: '10px 20px',
                backgroundColor: '#f44336',
                color: 'white',
                border: 'none',
                borderRadius: '5px',
                cursor: 'pointer',
                flex: 1,
                marginLeft: '5px',
              }}
            >
              Reject
            </button>
          </div>
        </div>
      )}
    </div>
  );
}

export default ViewRegistration;
